module.exports={
	path:'/basic/fitment',
	meta:{
		name:'装修登记'
	},
	component:()=>import('./index'),
	children:[
		{
			path:'basic/fitment',
			meta:{
				name:'全部装修',
				nav:true
			},
		component:()=>import('./list')
		},
		{
			path:'fitment/create',
			meta:{
				name:'新建登记',
				nav:true
			},
			compenent:()=>import('./create')
		},
		{
			path:"fitment/detail",
			meta:{
				name:"装修详情",
				nav:false
			},
			component:()=>import('./detail')
		}
	]
	
}
